exports=async function(bid,options){const{parseCatalogPaginate,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions)};return parseCatalogPaginate(page=>`https://www.msxs.vip/index.php?m=art-type-id-${bid}${1===page?"":"-pg-"+page}.html`,{cleaner:html=>cleanCatalogWrapper(html,/class="list-group"/,"</div>",-1),recordRegex:hrefRecordRegex},{...options,clientOptions,pageSize:15,totalPagesRegex:/当前:\d+\/(?<totalPages>\d+)页/})};